import { Button, ButtonGroup, Checkbox } from '@material-ui/core';

function App() {
  return (
    <div className="App">
      <h1>React MUI</h1>

      <ButtonGroup color="primary">
        <Button>Click me1 MUI</Button>
        <Button>Click me2 MUI</Button>
      </ButtonGroup>

      <Checkbox value="parthvi">Check Me</Checkbox>
      <button>click</button>
    </div>
  );
}

export default App;
